import { useState } from 'react';
import '../src/styles.css'
import { Card, Typography } from '@mui/material';
import { PieCharts } from '@mui/x-charts';
import Dashboard from './Dashboard';
import Projects from './Projects';

export default function Matter() {

    return (
        <div
        style={{
            height: "100vh",
            width: "80%",
            margin: "auto",
            textAlign:"center",
            backgroundColor: "white",
            color: "black"
        }}
    >
       <Card
        className='card'
       >
        <div    
            style={{
                padding:"10px",

            }}
            >
            <Typography variant='h4'>About me.</Typography>
            <Typography variant='body'>Im a Software Engineer.</Typography>
        </div>
       </Card>
       <Card
             className='card'
       >
        <Typography variant='h4'>Career Pulse</Typography>
        <Typography variant='body'> The dashboard below highlights my skills and Roles I have held over the past 5 odd years.</Typography>
        <Dashboard></Dashboard>
       </Card>
       <Card>
        <Projects></Projects>
       </Card>

    </div>
    )
}
